  const count = 5
  const { data } = useGetProductsQuery(count);
  const pages = data.total/count
  console.log(data);


  return (
    <div >
      {data &&  data.products.map((p) => (
        <ProductItem title={p.title} img={p.images[0]} price={p.price} descr={p.description} count={p.stock}/>
      ))}
      {pages.map()}
    </div>
  );
};
